import React from "react";

const Partner = () => {
  return (
    <div className="my-24 items-center justify-center flex">
      <p className="text-[34px] font-semibold">Partners</p>
      <div className="container grid grid-cols-2"></div>
    </div>
  );
};

export default Partner;
